DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `orders` (
  `id` varchar(30) NOT NULL COMMENT '订单ID',
  `create_time` datetime NOT NULL,
  `delivery_time` datetime DEFAULT NULL,
  `shipping_channel` varchar(20) DEFAULT NULL COMMENT '发货渠道',
  `tracking_number` varchar(30) DEFAULT NULL COMMENT '物流跟踪号',
  `order_status` varchar(20) NOT NULL COMMENT '订单状态',
  `product_name` varchar(200) DEFAULT NULL COMMENT '产品名称',
  `product_online_sku` varchar(50) NOT NULL COMMENT '线上SKU',
  `product_link_sku` varchar(50) DEFAULT NULL COMMENT '关联SKU',
  `product_price` decimal(10,0) NOT NULL,
  `product_quantity` int(11) NOT NULL COMMENT '订单商品数量',
  `product_image_url` varchar(200) DEFAULT NULL COMMENT '产品图片',
  `username` varchar(100) NOT NULL COMMENT '订单收件人名称',
  `tel` varchar(20) NOT NULL COMMENT '收件人电话',
  `country` varchar(50) NOT NULL COMMENT '国家',
  `state` varchar(30) NOT NULL COMMENT '省/州',
  `city` varchar(30) NOT NULL COMMENT '城市',
  `address` varchar(100) NOT NULL COMMENT '地址',
  `zip_code` varchar(10) NOT NULL COMMENT '邮编',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
